import React from 'react';


function App()
{
    return (
        <div className="cards">
        <div className="card">
        <img src="https://upload.wikimedia.org/wikipedia/en/f/f3/Supergirl_season_5.jpg" alt="Supergirl" className="card_img" />


        </div>

        </div>
    );
} 
export default App;
